import ListPersonsComponent from "./ShowPersons/ListPersonsComponent";
import Login from "./Login/login";
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Signup from './SignUp/Signup';
import NewTask from "./NewTask/NewTask";
import Handover from "./Handover/Handover";
import ForgotPassword from "./ForgotPassword/ForgotPass";
import FollowUpTask from "./FollowUpTask/FollowUpTask";

function App() {
    return (
        <div>
            <Router>
                <div className="container">
                    <Routes>
                        <Route path="/" exact component = {Login}></Route>
                        <Route path="/persons" exact component = {ListPersonsComponent}></Route>
                        <Route path="/create_hospital_personnel" exact component = {Signup}></Route>
                        <Route path="/create_task" exact component = {NewTask}></Route>
                        <Route path="/handover" exact component = {Handover}></Route>
                        <Route path="/forgot_password" exact component = {ForgotPassword}></Route>
                        <Route path="/follow_up_task" exact component = {FollowUpTask}></Route>
                    </Routes>
                </div>
            </Router>
        </div>
    );
}

export default App;
